import React, {Component} from 'react';
import style from '../../Static/Style';
import popUp from './popUp';


class Header extends Component{

    render(){
        return(<header>
            {style}
                <div className="header-left">
                    <h1>
                        {this.props.header}
                    </h1>
                </div> 
                <div className="header-right">
                    <ul>
                        <li>
                        <popUp />
                        </li>
                    </ul>
                </div>
                <hr />           
            </header>
            )
        }
}

export default Header;
